import { useState, useEffect } from "react";
import "./App.css";
function App() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8000/data")
      .then((res) => {
        return res.json();
      })
      .then((db) => {
        setData(db.advisorProfileCollection.items);
      });
  }, []);
  if( data){
    data.map((item)=>{console.log(item.avatartUrl);})
  }
  console.log(data);
  return (<></>)
}

export default App;
